function App() {
    return (
        <div className="App">
            <h1>LDR MUSIC LIBRARY</h1>
            <h4>What would you like to do?</h4>

            <div className="navigation">
                <ul>
                    <li>Show All Songs</li>
                    <li>Search & Edit</li>
                    <li>Add New</li>
                </ul>
            </div>
        </div>
    );
}

export default App;
